import Grid from '@mui/material/Grid'
import Paper from '@mui/material/Paper'
import Typography from '@mui/material/Typography'
import Box from '@mui/material/Box'
import Rating from '@mui/material/Rating'
import React, { useState } from 'react'
import styled from 'styled-components'
import { createTheme, ThemeProvider } from '@mui/material'

import { AccessTime } from '@mui/icons-material'
import '../App.css'

const theme = createTheme({
  components: {
    MuiTypography: {
      variants: [
        {
          props: {
            variant: 'body2',
          },
          style: {
            fontSize: 11,
          },
        },
        {
          props: {
            variant: 'body3',
          },
          style: {
            fontSize: 9,
          },
        },
      ],
    },
  },
})

const Card = (tour) => {
  const [value, setValue] = useState(0)
  const [reviews, setReviews] = useState(0)
  return (
    <Grid item xs={3} pl={2} pr={2}>

      <ThemeProvider theme={theme}>
        <Paper elevation={3}>
          <Img url={tour.image}></Img>
          <Box padding={1}>
            <Typography variant="subtitle1" component="h2">
              Immerse into the Falls
            </Typography>
            <Box
              width="100px"
              sx={{
                display: 'flex',
                alignItems: 'center',
                textAlign: 'start',
              }}
            >
              <AccessTime fontSize="small"></AccessTime>
              <Typography ml={1} variant="body2" component="p">
                5 hours
              </Typography>
            </Box>
            <Box
              sx={{
                display: 'flex',
                alignItems: 'center',
                textAlign: 'start',
                justifyItems: 'center',
                flexWrap: 'wrap',
              }}
              mt={2}
            >
              <Typography component="legend">별점</Typography>
              <Rating name="read-only" value={value} readOnly precision={0.5} />
              <Typography ml={1} variant="body2" component="p">
                {value}
              </Typography>
              <Typography ml={1} variant="body2" component="p">
                {reviews} reviews
              </Typography>
            </Box>
            <Box>
              <Typography mt={1} ml={1} variant="h6" component="h3">
                From C $147
              </Typography>
            </Box>
          </Box>
        </Paper>
      </ThemeProvider>
    </Grid>
  )
}

export default Card

const Img = styled.img`
  width: 100%;
  height: 200px;
  background-image: url(${(props) => props.url};
  background-position: center;
  background-size: cover;
  background-repeat: no-repeat;;
`
